import React from 'react';
import {
    Container,
    DivImage,
    Imagee
} from './styled';

export default ({data}) => {

    return(
        <Container>
            <DivImage>
                <Imagee src={data.image} />
            </DivImage>
            {data.titulo}
            {data.descricao}
            {data.visualizacaoes}
            {data.tempo}

        </Container>
    );
}
